  <body>
    <div id="content"></div>
    <script type="text/babel">

    var App = React.createClass({
      getInitialState : function() {
         return { showContact : false };
      },
      onClickContact : function() {
         this.setState({ showContact : true} );
      },
      onClickHome : function() {
         this.setState({ showContact : false} );
      },
      render: function() {
        if(this.state.showContact) { 
          return (
            <div>
              <div className="ph-line-nav nav">
                <a onClick={this.onClickHome}>Wong</a>
                
                <a onClick={this.onClickContact}>Contact</a>
                <div className="effect" />
              </div>
              <h1>No<sub> contact</sub></h1>
              <div id="titles">
                <div id="titlecontent">
                  <p className="center">Nope</p>
                  <p> </p>
                  <p>Nada. </p><p>Ask Google like everyone else. </p>
                  <p>Okay, if you insist, </p><p>I am on Twitter. </p>   
                </div>
              </div>
              <div id="ciskype" />
              <div id="bottom-left" />
            </div>
          );
        } else { 
            return (
          <div>
            <div className="ph-line-nav nav">
                <a onClick={this.onClickHome}>Wong</a>
                 
                <a onClick={this.onClickContact}>Contact</a>
              <div className="effect" />
            </div>

            <h1>The Wong<sub> And Only</sub></h1>
            <div id="titles">
              <div id="titlecontent">
                <p className="center">Hello</p>
                <p> </p>
                <p>I know you're out there. </p>
                <p>I can feel you now. </p>
                <p>I know that you're afraid... you're afraid of us. </p>
                <p>You're afraid of change. </p>
                <p>I don't know the future. </p>
                <p>I didn't come here to tell you how this is going to end.</p>
                <p>I came here to tell you how it's going to begin. </p>
                <p>I'm going to hang up this phone, </p>
                <p>and then I'm going to show these people </p>
                <p>what you don't want them to see. </p>
                <p>I'm going to show them a world without you.</p> 
                <p>A world without rules and controls, </p>
                <p>without borders or boundaries. </p>
                <p>A world where anything is possible. </p>
                <p>Where we go from there is a choice I leave to you.</p>
              </div>
            </div>
            <div id="bottom-left" />
          </div>
        );
        } 
      }
    });
 
    ReactDOM.render(
      <App />,
      document.getElementById('content')
    );
    </script>
